// src/sections/Services/Services.jsx
import React from "react";
import styles from "./Services.module.css";

// Sample services data (you can move this to a separate data file later)
const services = [
  {
    title: "Web Development",
    description:
      "Building responsive and dynamic websites using React, Node.js, and MongoDB.",
    icon: "🌐",
  },
  {
    title: "UI/UX Design",
    description:
      "Creating user-friendly and modern interfaces with smooth animations.",
    icon: "🎨",
  },
  {
    title: "Backend APIs",
    description:
      "Designing RESTful APIs with Node.js and Express for seamless data flow.",
    icon: "🔧",
  },
];

const Services = () => {
  return (
    <section id="services" className={styles.services}>
      <h2>What I Do</h2>
      <div className={styles.servicesGrid}>
        {services.map((service, index) => (
          <div key={index} className={styles.card}>
            <div className={styles.icon}>{service.icon}</div>
            <h3>{service.title}</h3>
            <p>{service.description}</p>
          </div>
        ))}
      </div>
    </section>
  );
};

export default Services;
